<script>
	import { MessageBox } from 'mint-ui'
  import Headerbtns from '../../../src/components/policy/common/Header'
  import downInfoTest from '../../../static/dict/downInfoTest.json'
  import alert from '../policy/common/alert.vue'

	export default{
		name:'info',
    components: {Headerbtns,alert},
    props: ['value'],
		data () {
	    return {
        dict:{
          downInfoTest:downInfoTest
        },
        down:true,
        toggle:{
          isSearch:false,//是否为查询
        },
	    	page_title:'光速宝下载',
        searchParameter:'',
        current:"2",
        personsal:"",
        orgIndex:"",
        android_2:"data:image/jpg;base64,",
        android_1:"data:image/jpg;base64,",
        ios_2:"data:image/jpg;base64,",
        ios_1:"data:image/jpg;base64,"
      }
	  },
	  beforeMount(){
      
	  },
	  mounted(){
      let platform = this.$route.params.platform
      this.orgIndex = platform
      if(platform == undefined && platform == ""){
        this.showMsg("参数非法!!!")
        return
      }
      if(platform != 1 && platform != 2){
        this.showMsg("参数非法!!!")
        return
      }
      this.getVersion(2)
	  },
	  methods:{
      getVersion(index){
        let requ = {
          "order":{
            "channel": index,
          }
        }
        utils.http.postFast('MOGETVERSION',requ,(body)=> {
          let personsal = body.personsal
          this.personsal = personsal
          if(this.current == "2"){
            document.getElementById("ios_mob").style.display = "none"
            document.getElementById("ios_pad").style.display = "none"
            document.getElementById("ios_ins").style.display = "none"
            if(personsal.mobile_URL!="" && personsal.downloadUrlMobile!=""){
              document.getElementById("ios_mob").style.display = "block"
              document.getElementById("a_ios_mob").href = personsal.mobile_URL
              document.getElementById("img_ios_mob").src = personsal.downloadUrlMobile
            }
            if(personsal.pad_URL!="" && personsal.downloadUrlPad!="" && this.orgIndex == 1){
              document.getElementById("ios_pad").style.display = "block"
              document.getElementById("a_ios_pad").href = personsal.pad_URL
              document.getElementById("img_ios_pad").src = personsal.downloadUrlPad
            }
            if(personsal.install_URL!="" && personsal.install_URL!=""){
              document.getElementById("ios_ins").style.display = "block"
              document.getElementById("img_ios_ins").src = personsal.install_URL
            }
          }else if(this.current == "1"){
             document.getElementById("android_mob").style.display = "none"
             document.getElementById("android_pad").style.display = "none"
             document.getElementById("android_ins").style.display = "none"
             if(personsal.mobile_URL!="" && personsal.downloadUrlMobile!=""){
               document.getElementById("android_mob").style.display = "block"
               document.getElementById("a_android_mob").href = personsal.mobile_URL
               document.getElementById("img_android_mob").src = personsal.downloadUrlMobile
             }
             if(personsal.pad_URL!="" && personsal.downloadUrlPad!="" && this.orgIndex == 1){
               document.getElementById("android_pad").style.display = "block"
               document.getElementById("a_android_pad").href = personsal.pad_URL
               document.getElementById("img_android_pad").src = personsal.downloadUrlPad
             }
             if(personsal.install_URL!="" && personsal.install_URL!=""){
              document.getElementById("android_ins").style.display = "block"
              document.getElementById("img_android_ins").src = personsal.install_URL
            }
          }
        })
      },
      showMsg:function(msg){
        if(msg!=undefined && msg!=""){
          this.$refs.alert.showMOdal(msg)
        }
      },
      handleClick(index){
        if(this.orgIndex == undefined && this.orgIndex == ""){
          this.showMsg("参数非法!!!")
          return
        }
        if(this.orgIndex != 1 && this.orgIndex != 2){
          this.showMsg("参数非法!!!")
          return
        }
        if(index == 2 && index != this.current){
          this.current = index
          this.down = !this.down
          document.getElementById("img_ios").src = this.ios_1
          document.getElementById("img_android").src = this.android_2
        }else if(index == 1 && index != this.current){
          this.current = index
          this.down = !this.down
          document.getElementById("img_ios").src = this.ios_2
          document.getElementById("img_android").src = this.android_1
        }
        this.getVersion(index)
      }
	  }
	}
</script>

